import './App.css';
import UserInfo from './Userinfo';

const name = "Bernard";

function App() {

  const userObj = { name: "bernard", age: 21, dp : "jjj.jpg" }

  return (
    <div className="container">
      <UserInfo username={name} age={userObj.age} image={userObj.dp}/>
    </div>
  );
}

export default App;
